const renderSearchRow = (item, index) => {
  return (
    <SearchRow
      key={`${item.type}-${item.songId || item.artistId}`}
      type={item.type}
      cover={item.cover || item.avatar}
      content={item.songName || item.artistName}
      desc={
        item.type === 'song'
          ? `${item.artistName}${item.albumName ? ` • Album: ${item.albumName}` : ''}`
          : 'Nghệ sĩ nổi bật'
      }
    />
  );
};

function Header() {
  // SEARCH
  const [searchKeyword, setSearchKeyword] = useState('');
  const [searchResults, setSearchResults] = useState([]);

  // USER TOKEN
  const [currentToken, setCurrentToken] = useState(''); // mặc định không có token
  const [roles, setRoles] = useState([]);

  // Khi currentToken thay đổi => ghi localStorage + decode role
  useEffect(() => {
    if (!currentToken) {
      localStorage.removeItem('token'); // không có token => xóa
      setRoles([]);
      return;
    }
    const tokenFake = tokens[currentToken];
    localStorage.setItem('token', tokenFake);
    try {
      const decoded = jwtDecode(tokenFake);
      let userRoles = decoded.roles || [];
      if (typeof userRoles === 'string') {
        userRoles = userRoles.split(',').map(r => r.trim().toUpperCase());
      }
      setRoles(userRoles);
    } catch (error) {
      console.log('invalid token', error);
      setRoles([]);
    }
  }, [currentToken]);

  // kiểm tra token
  const token = localStorage.getItem('token');
  const isLoggedIn = !!token;

  const isArtist = roles.includes('ARTIST');
  const isAdmin = roles.includes('ADMIN');

  const handleLogout = () => {
    setCurrentToken('');
    localStorage.removeItem('token');
    setRoles([]);
  };

  // nhập keyword trong input search
  const handleInputSearch = e => {
    const value = e.target.value;
    setSearchKeyword(value);

    if (value.trim() === '') {
      setSearchResults([]);
    } else {
      const keyword = value.toLowerCase();

      // Tìm kiếm nghệ sĩ trước
      const matchedArtists = apiFavoriteArtists
        .filter(artist => artist.artistName.toLowerCase().includes(keyword))
        .map(artist => ({ ...artist, type: 'artist' }));

      // Sau đó đến bài hát
      const matchedSongs = apiNewSongs
        .filter(
          song => song.songName.toLowerCase().includes(keyword) || song.artistName.toLowerCase().includes(keyword)
        )
        .map(song => ({ ...song, type: 'song' }));

      // Gộp kết quả: nghệ sĩ trước
      setSearchResults([...matchedArtists, ...matchedSongs]);
    }
  };

  return (
    <nav className="navbar navbar-expand-lg navbar-light fixed-top custom-navbar">
      <div className="container-fluid d-flex align-items-center justify-content-between">
        {/* Logo + Search */}
        <div className="d-flex align-items-center flex-grow-1 gap-3">
          {/* Logo */}
          <a className="navbar-brand mb-0" href="/">
            {/* <i className="fab fa-linkedin fa-2x"></i> */}
            <img className="navbar-logo" src={images.logo} alt="VieMp3" />
          </a>
          {/* Search form */}
          <Tippy
            visible={searchKeyword.length > 0 && searchResults.length > 0}
            interactive
            placement="bottom-start"
            onClickOutside={() => setSearchKeyword('')}
            render={attrs => (
              <div className="tippy-popup-box" tabIndex="-1" {...attrs}>
                <h6>Gợi ý kết quả</h6>
                <LimitedList
                  items={searchResults}
                  renderItem={renderSearchRow}
                  showAllText="Hiện tất cả kết quả"
                  showLessText="Ẩn bớt"
                  wrapInRow={false}
                />
              </div>
            )}
          >
            <form className="input-group search-form w-50">
              <input
                type="search"
                className="form-control"
                placeholder="Bạn muốn phát nội dung gì?"
                aria-label="Search"
                value={searchKeyword}
                onChange={handleInputSearch}
              />
              <button className="btn btn-outline-custom" type="button">
                <i className="fas fa-search"></i>
              </button>
            </form>
          </Tippy>

          {/* Voice button */}
          <button className="btn voice-btn">
            <i className="fas fa-microphone"></i>
          </button>
        </div>

        {/* Toggle button */}
        <button
          className="navbar-toggler ms-3"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <i className="fas fa-bars"></i>
        </button>

        {/* Collapsible content */}
        <div className="collapse navbar-collapse justify-content-end" id="navbarSupportedContent">
          <ul className="navbar-nav navbar-nav-header d-flex align-items-center flex-row gap-3 mb-0">
            {/* Nút Khám phá Premium */}
            <li>
              <LongButton href="/premium" backgroundColor="var(--white-color)" color="var(--black-color)">
                Khám phá Premium
              </LongButton>
            </li>

            {/* Nếu đã đăng nhập */}
            {isLoggedIn ? (
              <>
                {[
                  { icon: 'comment-dots', label: 'Messaging' },
                  { icon: 'bell', label: 'Notifications' },
                ].map((item, i) => (
                  <li key={i} className="nav-item position-relative icon-tooltip-wrapper">
                    <a className="nav-link d-flex flex-column text-center" href="#" onClick={e => e.preventDefault()}>
                      <i className={`fas fa-${item.icon} fa-lg my-1`}></i>
                      <div className="icon-tooltip">{item.label}</div>
                    </a>
                  </li>
                ))}

                {/* Avatar dropdown */}
                <li className="nav-item dropdown">
                  <a
                    className="nav-link dropdown-toggle d-flex align-items-center"
                    href="#"
                    id="navbarDropdownMenuLink"
                    role="button"
                    data-bs-toggle="dropdown"
                    aria-expanded="false"
                    onClick={e => e.preventDefault()}
                  >
                    <img
                      src={images.avatarDefault}
                      className="rounded-circle"
                      height="40"
                      alt="Avatar"
                      loading="lazy"
                    />
                  </a>
                  <ul className="dropdown-menu custom-dropdown-left" aria-labelledby="navbarDropdownMenuLink">
                    <li>
                      <a className="dropdown-item" href="/profile">
                        <i className="fas fa-user me-2"></i> Hồ sơ
                      </a>
                    </li>

                    {/* ARTIST */}
                    {isArtist && (
                      <>
                        <li>
                          <a className="dropdown-item" href="/my-songs">
                            <i className="fas fa-music me-2"></i> Bài hát của tôi
                          </a>
                        </li>
                        <li>
                          <a className="dropdown-item" href="/my-albums">
                            <i className="fas fa-compact-disc me-2"></i> Album của tôi
                          </a>
                        </li>
                      </>
                    )}

                    {/* ADMIN */}
                    {isAdmin && (
                      <>
                        <li>
                          <a className="dropdown-item" href="/manage-users">
                            <i className="fas fa-users-cog me-2"></i> Quản lý người dùng
                          </a>
                        </li>
                        <li>
                          <a className="dropdown-item" href="/moderate-songs">
                            <i className="fas fa-check-circle me-2"></i> Kiểm duyệt bài hát
                          </a>
                        </li>
                      </>
                    )}

                    <li>
                      <hr className="dropdown-divider" />
                    </li>
                    <li>
                      <a className="dropdown-item" href="/logout">
                        <i className="fas fa-sign-out-alt me-2"></i> Đăng xuất
                      </a>
                    </li>
                  </ul>
                </li>
              </>
            ) : (
              <>
                {/* Nếu chưa đăng nhập */}
                <li>
                  <ShortButton
                    color="var(--white-color)"
                    backgroundColor="var(--black-color-light-2)"
                    borderColor="var(--black-dark-color)"
                    href="/register"
                  >
                    Đăng ký
                  </ShortButton>
                </li>
                <li>
                  <ShortButton
                    color="var(--white-color)"
                    backgroundColor="var(--primary-color)"
                    borderColor="var(--black-dark-color)"
                    href="/login"
                  >
                    Đăng nhập
                  </ShortButton>
                </li>
              </>
            )}
          </ul>
        </div>
      </div>
    </nav>
  );
}

export default Header;
